# 3. Interval YAML format
sample:sample:
  container-val:
    a: A
    enum-val: enum2
    leaf-list-val:
      - leaf-list-first
      - leaf-list-fourth
      - leaf-list-second
      - leaf-list-third
    test-default: 11
  empty-val:
  multiple-key-list[str=first][integer=1]:
    ok: true
  multiple-key-list[str=first][integer=2]:
  non-key-list:
    - strval: "XYZ"
      uintval: 10
  single-key-list[list-key=AAA]:
    "country-code": "KR"
    "decimal-range": 1.01
    "empty-node":
    "list-key": "AAA"
    "uint32-range": 100
    "uint64-node": 1234567890
  str-val: "abc"